package org.sieca.everis.pdcc.model.transportista;

public class MediosTransporte {
	
	private String nroPlaca;
	private String nroEjes;
	private String nroMotor;
	private String nroChasis;
	private String marca;
	private String modelo;
	private String anio;
	private String tipo;
	private String estado;
	private String observaciones;
	/**
	 * 
	 */
	public MediosTransporte() {
		super();
		// TODO Auto-generated constructor stub
	}
	/**
	 * @param nroPlaca
	 * @param nroEjes
	 * @param nroMotor
	 * @param nroChasis
	 * @param marca
	 * @param modelo
	 * @param anio
	 * @param tipo
	 * @param estado
	 * @param observaciones
	 */
	public MediosTransporte(String nroPlaca, String nroEjes, String nroMotor, String nroChasis, String marca,
			String modelo, String anio, String tipo, String estado, String observaciones) {
		super();
		this.nroPlaca = nroPlaca;
		this.nroEjes = nroEjes;
		this.nroMotor = nroMotor;
		this.nroChasis = nroChasis;
		this.marca = marca;
		this.modelo = modelo;
		this.anio = anio;
		this.tipo = tipo;
		this.estado = estado;
		this.observaciones = observaciones;
	}
	/**
	 * @return the nroPlaca
	 */
	public String getNroPlaca() {
		return nroPlaca;
	}
	/**
	 * @param nroPlaca the nroPlaca to set
	 */
	public void setNroPlaca(String nroPlaca) {
		this.nroPlaca = nroPlaca;
	}
	/**
	 * @return the nroEjes
	 */
	public String getNroEjes() {
		return nroEjes;
	}
	/**
	 * @param nroEjes the nroEjes to set
	 */
	public void setNroEjes(String nroEjes) {
		this.nroEjes = nroEjes;
	}
	/**
	 * @return the nroMotor
	 */
	public String getNroMotor() {
		return nroMotor;
	}
	/**
	 * @param nroMotor the nroMotor to set
	 */
	public void setNroMotor(String nroMotor) {
		this.nroMotor = nroMotor;
	}
	/**
	 * @return the nroChasis
	 */
	public String getNroChasis() {
		return nroChasis;
	}
	/**
	 * @param nroChasis the nroChasis to set
	 */
	public void setNroChasis(String nroChasis) {
		this.nroChasis = nroChasis;
	}
	/**
	 * @return the marca
	 */
	public String getMarca() {
		return marca;
	}
	/**
	 * @param marca the marca to set
	 */
	public void setMarca(String marca) {
		this.marca = marca;
	}
	/**
	 * @return the modelo
	 */
	public String getModelo() {
		return modelo;
	}
	/**
	 * @param modelo the modelo to set
	 */
	public void setModelo(String modelo) {
		this.modelo = modelo;
	}
	/**
	 * @return the anio
	 */
	public String getAnio() {
		return anio;
	}
	/**
	 * @param anio the anio to set
	 */
	public void setAnio(String anio) {
		this.anio = anio;
	}
	/**
	 * @return the tipo
	 */
	public String getTipo() {
		return tipo;
	}
	/**
	 * @param tipo the tipo to set
	 */
	public void setTipo(String tipo) {
		this.tipo = tipo;
	}
	/**
	 * @return the estado
	 */
	public String getEstado() {
		return estado;
	}
	/**
	 * @param estado the estado to set
	 */
	public void setEstado(String estado) {
		this.estado = estado;
	}
	/**
	 * @return the observaciones
	 */
	public String getObservaciones() {
		return observaciones;
	}
	/**
	 * @param observaciones the observaciones to set
	 */
	public void setObservaciones(String observaciones) {
		this.observaciones = observaciones;
	}

	
	
	

}
